import React, { useState } from 'react'
import Card from './components/card'
import Navbar from './components/navbar'
function App() {
 
  const data = [{name:"Ve Haniya ", artist:"Avvy sara",added:true, image:"data:image/jpeg;base64,"},
  {name:"Akhiyaan gulab",artist:"Mitraz",added:false, image:"data:image/jpeg;base64,"},{
    name:"Heer asmani",artist:"B-prrak",added:false,image:"data:image/jpeg;base64,"
  },{name:"Janam",artist:"j noize", image:"https://plus.unsplash.com/premium_photo-1683910767532-3a25b821f7ae?w=500&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MXx8ZnJlZSUyMGltYWdlc3xlbnwwfHwwfHx8MA%3D%3D", added:true },

  ];
  const[songData,setsongData] = useState(data);
  const click = (idx)=>{
    setsongData((prev)=>{
      return prev.map((item,i)=>{
        if(i===idx){
          return {
         ...item,
            added:!item.added
          }
        }
        return item;
      })
    })
  
  }
  return (
    <div>
    <div className='bg-zinc-200 '>
    <Navbar data={songData} />
    </div >
    <div className='flex'>
     <div className='flex-wrap flex h-full'>
     {songData.map((item,index)=>(
          <Card values={item} click={click} idx={index} />
     ))}
       
      </div>  
      <div className='w-96 h-[88vh] bg-sky-200 p-4 mt-2 my-0 flex justify-center'> 
      <h1 className='font-semibold text-xl text-yellow-600' >Musify</h1>
      </div>
      </div>   
    </div>
  )

}


export default App
